```cuda
__global__ void matrixMult(float* A, float* B, float* C, int n) {
  int id = blockDim.x * blockIdx.x + threadIdx.x;
  int j = blockDim.x * blockIdx.y + threadIdx.y;
  float sum = 0;

  \/\/ Load matrix A and B into shared memory
  __shared__ float As[n];
  __shared__ float Bs[n];
  As[threadIdx.x] = A[id * n + j];
  Bs[threadIdx.x] = B[j * n + id];
  __syncthreads();

  \/\/ Compute product using shared memory
  for (int k = 0; k < n; k++) {
    sum += As[k] * Bs[k];
    __syncthreads();
  }

  \/\/ Store result in output matrix C
  C[id * n + j] = sum;
}
```

2. Use Registers: CUDA's registers are fast, on-chip storage that can be accessed by a single thread. By storing frequently accessed variables in registers, you can improve performance by reducing the number of memory accesses. For example:

```cuda
__global__ void factorial(int* num, int* result) {
  int n = *num;
  int factorial = 1;
  __asm__ volatile("" : : "cc", "memory");
  for (int I = 2; I <= n; i++) {
    factorial *= i;
    __asm__ volatile("" : : "cc", "memory");
  }
  *result = factorial;
}
```

