The async keyword in C# has two main purposes:

1. It allows a method to be marked as asynchronous, meaning it can run asynchronously without blocking the caller. This is achieved by the method returning an Task or Task<T> instead of a regular value.

2. It allows using the await keyword within an asynchronous method. The await keyword pauses the execution of the method until the awaited Task completes. This makes asynchronous code look synchronous, hiding the details of threading.

Some examples of using async\/await:

- Calling an API asynchronously:

```csharp
async Task GetDataAsync() {
   var result = await client.GetAsync("url");
   \/\/ Use result 
}
```

- Waiting for a Task to complete:

```csharp 
async Task DoWorkAsync() {
   Task task = LongRunningOperation();
   await task;  \/\/ Wait for task to complete  
}
```

- Async event handlers:

```csharp
async void Button_Click(object sender, EventArgs e) {
    await LoadDataAsync();
}
```

In summary, async\/await allows you to write asynchronous code that looks synchronous and easy to follow, while still freeing up the caller during the asynchronous operations.

